import React, { useState, useEffect } from 'react';
import { useParams } from "react-router-dom";
import { makeStyles } from '@mui/styles';
import { IEntity } from '../../types/interfaces';
import { CircularProgress, Typography, Button, Stack } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        margin: 0
    }
}));

const EntityView = () => {
    const classes = useStyles();
    let { type } = useParams();
    const [loading, setLoading] = useState(false);
    const [entity, setEntity] = useState<IEntity | null>(null);

    useEffect(() => {
        setLoading(true);
        fetch('/entityDetails/' + type).then(response => response.json).then((result) => {
            setLoading(false);
        })
    }, []);

    return (
        <>
            {loading && <CircularProgress />}
            <Stack spacing={2}>
                <Typography variant="h4">Entity</Typography>
                {!loading && <Button variant="outlined" onClick={postLogin}>Submit</Button>}

            </Stack>
        </>
    );
};

export default EntityView;
